import React, { Component } from 'react'

class Users extends Component {
  render() {
    const{id,username,salary}=this.props;
    return (
      <ul>
        <li>Id: {id}</li>
        <li>Username: {username}</li>
        <li>Salary: {salary}</li>
      </ul>
    )
  }
}

export default Users
